import React from "react";
import { css } from "@emotion/react";;
import Navbar from "../Navbar/Navbar";
import QuestionChoice from "../QuestionChoice/QuestionChoice";

const Home = () => {
  return (
    <div css={styles.container}>
      
      <Navbar />
      <QuestionChoice />
    </div>
  );
};
const styles = {
   container: css`
    min-height: 100vh;
    background-color: #f0f0f0;
  `,
};

export default Home;
